import React from "react";

function PSSpreadsheet() {
  // profit summary spreadsheet

  return (
  <table>
    <tr>
      <td>Revenue</td>
      <td className="price">$ 0,000</td>
    </tr>
    <tr>
      <td>Cost of Sales</td>
      <td className="price">-$ 0,000</td>
    </tr>
    <tr className="total">
      <td>Gross Profit</td>
      <td className="price">$ 0,000</td>
    </tr>
  </table>
  )}

export default PSSpreadsheet
